import React, { Component } from 'react';
import Dropdown from './Dropdown';
import Header from './Header';

const menu = [
  {
    link: './Home',
    label: 'Home'
  },
  {
    link: '/About',
    label: 'About'
  },
  {
    link: './Contacts',
    label: 'Contacts'
  }
];

class App extends Component {
  render() {
    return (
      <div>
        <Header items={menu}/>
        <Dropdown />
      </div>
    );
  }
}

export default App;
